// Default fallback photo
const defaultPhoto = require('../../assets/images/icon.png');

/**
 * Get public figure photo for a bioguide ID or slug
 * Returns local asset path or fallback
 */
export function getPublicFigurePhoto(id: string): any {
  const photoData = publicFigurePhotoMap[id];
  if (photoData?.photo) {
    return photoData.photo;
  }
  
  console.log(`⚠️ No photo found for ID: ${id}`);
  return defaultPhoto;
}

/**
 * Get public figure photo info (source, name, etc.)
 */
export function getPublicFigurePhotoInfo(id: string): {
  source: string;
  name: string;
  chamber: string;
  party: string;
  state: string;
  congress: string;
  path: string;
} | null {
  const photoData = publicFigurePhotoMap[id];
  if (photoData) {
    return {
      source: photoData.source,
      name: photoData.name,
      chamber: photoData.chamber,
      party: photoData.party,
      state: photoData.state,
      congress: photoData.congress,
      path: photoData.path
    };
  }
  return null;
}

/**
 * Check if we have a photo for an ID
 */
export function hasPublicFigurePhoto(id: string): boolean {
  return !!publicFigurePhotoMap[id]?.photo;
}

/**
 * Get all available public figure photos
 */
export function getAllPublicFigurePhotos(): Record<string, any> {
  return { ...publicFigurePhotoMap };
}

// Legacy functions for backwards compatibility
export function getCongressionalPhoto(bioguideId: string): any {
  return getPublicFigurePhoto(bioguideId);
}

export function getCongressionalPhotoInfo(bioguideId: string): any {
  return getPublicFigurePhotoInfo(bioguideId);
}

export function hasCongressionalPhoto(bioguideId: string): boolean {
  return hasPublicFigurePhoto(bioguideId);
}

export function getAllCongressionalPhotos(): Record<string, any> {
  return getAllPublicFigurePhotos();
}

console.log(`📸 Public figure photos loaded: ${Object.keys(publicFigurePhotoMap).length} figures`);
